import './index.css'

const PasswordLogin = ({props}) =>{

    const [initialPassword,setInitialPassword] = useState('');

    return (
        <>
            <form>
                <input className='password' placeholder='Password' value={initialPassword} onChange={(event)=>setInitialPassword(event.target.value)}/>


            </form>
        </>
    )

}

export default PasswordLogin;
